import React from 'react';


class Users extends React.Component{
    users = [
        {id:1,
            firstname: 'Bob',
            lastname: 'Matly',
            bio: 'A dsafhj a uythe abd jgkdfg',
            age: 40,
            isHappy: true

            },
            {
                id:2,
                firstname: 'John',
                lastname: 'Doe',
                bio: 'A dsafhj a uythe abd jgkdfg ddd asdwqeasd',
                age: 20,
                isHappy: false
                }

    ]
    render(){
        if(this.users.length > 0)
            return (<div>
                {this.users.map((el) => (<div className='user' key={el.id}>
                    <h3>{el.firstname} {el.lastname}</h3>
                    <p>{el.bio}</p>
                    <b>{el.isHappy}</b>
                </div>))}
            </div>)
        else
        return(<div className='user'><h3>Not found</h3></div>)
    }
  }

  export default Users
